import React from "react";
import '../App.css';
import dataFetch from '../api/parkData'


export default function HikingFacts() {

    const [parks, setParks] = React.useState([]);

    React.useEffect(() => {
      dataFetch()
        .then(response => setParks(response))
        .catch(error => console.log(error));
    }, [])
    const parksArray = parks.features.map(park => {
      return (
        <div>
        <p>{park.attributes.PARK_NAME}</p>
        </div>
      )
    })


    return (
        <div className="facts-container">
            <h1>Hiking Facts</h1>
            <ul>
                <li>Hiking is fun</li>
                <li>There can be initial costs, but it is usually inexpensive</li>
                <li>Fresh air and exercise is good for health</li>
                <li>Nature is beautiful</li>
            </ul>
            <p>Parks:</p>
            {parks && parksArray}
        </div>

    )
}
